SortBy\n  Scenario: To validate user can select fastest functionality and cheapest functionality simultaneously\n    When User clicks on fastest option\n    And User clicks on cheapest option\n    Then list of buses in the order of fastest and cheapest bus first will be displayed\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/SSHRIVA2/Desktop/Sprint2/MMT_Bus/src/test/resource/Features/MMT_Bus.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@All","id":"7f79e391-fb97-48bb-ab06-e9df43224652"}],"language":"en","keyword":"Feature","name":"To test the Bus functionality to book bus ticket","description":"","children":[{"background":{"location":{"line":4,"column":3},"keyword":"Background","name":"","description":"","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"User is on homepage","id":"ceb65aea-4708-4ea3-a5f1-957ba5053a99"}],"id":"141b7ed5-ba8b-4610-9407-e1f6db3470ad"}},{"scenario":{"location":{"line":9,"column":3},"tags":[{"location":{"line":8,"column":3},"name":"@Search","id":"1ac6fc67-5ff0-4f9d-80f5-210cab7e6f0e"}],"keyword":"Scenario Outline","name":"To validate search functionality to book bus ticket","description":"","steps":[{"location":{"line":10,"column":5},"keyword":"When ","keywordType":"Action","text":"User enters the \"<source>\" Source","id":"ba4b5202-5a81-4969-95c3-552a6edd69c1"},{"location":{"line":11,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"User enters the \"<destination>\" destination","id":"409b0e04-3dba-4d8e-b331-6fb4fb3e8e5f"},{"location":{"line":12,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"User enters the \"<date>\" of travel","id":"751925e4-0726-4fa8-8ad7-a94e9be0f40c"},{"location":{"line":13,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"click on search","id":"563f6a34-5463-40e7-b5a8-c70c6ecf5721"},{"location":{"line":14,"column":5},"keywo
